	public void ParseJsonResponse(String response){
		
		try{
			
			JSONObject main = new JSONObject(response);
			JSONObject newJsonData = main.getJSONObject("NewDataSet");
			
			if(newJsonData.has("UserDetails")){
				
				
				if(newJsonData.get("UserDetails") instanceof JSONObject){
					JSONObject userJsonObject = newJsonData.getJSONObject("UserDetails");
					
					if(newJsonData.has("NoData")){
						String NoData = userJsonObject.getString("NoData");

					}
					else{
						
						String Emp_code ,name,Company_name,Department_name,Designation_name,D_o_j , D_o_B ,Address,Email_id,Userphoto,  Company_logo,BloodGroup,Auth_sign;
					
						
				
							
							if(userJsonObject.has("Address")){
								Address = userJsonObject.getString("Address");
								ed_botm_add.setText(Address);
							}
							if(userJsonObject.has("CompanyName")){
								Company_name =userJsonObject.getString("CompanyName");
								company_name.setText(Company_name);
								
							}
							if(userJsonObject.has("DateOfBirth")){
								D_o_B = userJsonObject.getString("DateOfBirth");
								ed_dob.setText(D_o_B);
							}
							if(userJsonObject.has("DateOfJoining")){
								D_o_j = userJsonObject.getString("DateOfJoining");
								ed_doj.setText(D_o_j);
							}
							
							if(userJsonObject.has("DepartmentName")){
								Department_name = userJsonObject.getString("DepartmentName");
								department_name.setText(Department_name);
							}
							if(userJsonObject.has("DesignationName")){
								Designation_name = userJsonObject.getString("DesignationName");
								designation_name.setText(Designation_name);
							}
							
							if(userJsonObject.has("BloodGroup")){
								BloodGroup = userJsonObject.getString("BloodGroup");
								ed_blood.setText(BloodGroup);
								
							}
								
							if(userJsonObject.has("Email")){
								Email_id = userJsonObject.getString("Email");
								ed_email.setText(Email_id);
							}
							
							if(userJsonObject.has("EmpCode")){
								Emp_code = userJsonObject.getString("EmpCode");
								ed_code.setText(Emp_code);
							}
							
							if(userJsonObject.has("Name")){
								name = userJsonObject.getString("Name");
								emp_name.setText(name);
							}
							
							if(userJsonObject.has("CompanyLogo")){
								Company_logo = userJsonObject.getString("CompanyLogo");
								
								byte[] image = Base64.decode(Company_logo, Base64.DEFAULT);
								 companylogo = (ImageView)findViewById(R.id.ivcompanyLogo);
								Bitmap bmmp = BitmapFactory.decodeByteArray(image,0,image.length);
								companylogo.setImageBitmap(bmmp);
								
								

							}
							if(userJsonObject.has("Photo")){
								Userphoto = userJsonObject.getString("Photo");
								
								byte[] image =  Base64.decode(Userphoto, Base64.DEFAULT);
								//ivPhoto = (CircularImageView)findViewById(R.id.ivPhoto);
								ivPhoto = (ImageView)findViewById(R.id.ivPhoto);
								Bitmap bm = BitmapFactory.decodeByteArray(image, 0, image.length);
								
								ivPhoto.setImageBitmap(bm);
							
							}
							
							if(userJsonObject.has("authorizedSignature")){
								Auth_sign = userJsonObject.getString("authorizedSignature");
								
								byte[] image =  Base64.decode(Auth_sign, Base64.DEFAULT);
								//ivPhoto = (CircularImageView)findViewById(R.id.ivPhoto);
								ivSignature = (ImageView)findViewById(R.id.ivSignature);
								Bitmap bm = BitmapFactory.decodeByteArray(image, 0, image.length);
								
								ivSignature.setImageBitmap(bm);
							
							}
							
						}
					}
					
				}
			
				
			
			
		}catch(Exception e){
			
			Utils.log("Error :",""+e);
		}
		
	}
	
	
